def _convert_key(self, key, is_setter: bool = False):
    """
    Require they keys to be the same type as the index. (so we don't
    fallback)
    """
    # allow arbitrary setting
    if is_setter:
        return list(key)

    for ax, i in zip(self.obj.axes, key):
        if isinstance(ax, Float64Index):
            if isinstance(i, int):
                i = float(i)
        elif isinstance(ax, DatetimeIndex) or isinstance(ax, TimedeltaIndex):
            if not isinstance(i, (pd.Timestamp, np.datetime64, pd.Timedelta, np.timedelta64)):
                raise ValueError(
                    "At based indexing on a datetime index or timedelta index "
                    "can only have datetime or timedelta indexers"
                )
        else:
            raise ValueError("Unsupported index type")

    return key
